import React, { Component } from "react";
import axios from "axios";
import { Col, Table } from "antd";
import { getData } from "../data/StoreData.ts";

const { Column, ColumnGroup } = Table;

export default class Directory extends Component {
  state = {
    tenants: [],
  };
  componentDidMount() {
    //code runs before the page loads
    axios
      .get("http://localhost:5000/api/tenants")
      .then((response) => {
        console.log(response);
        if (response.data.length > 0) {
          this.setState({
            tenants: response.data,
          });
        }
      })
      .catch((err) => {
        console.log("error occured when getting tenants");
      });
  }

  render() {
    return (
      <div className="panels">
        {/* <Table> */}
        {this.state.tenants.map((tenant, tenIndex) => {
          console.log(tenant);
          return <div>{tenant}</div>;
        })}
        {/* </Table> */}
      </div>
    );
  }
}

